jQuery(function ($) {
    $(document).ready(function () {

        /** Sweetalert **/
        swal.setDefaults({
            customClass: 'sweetalert-lg'
            , confirmButtonColor: '#5b9dd9'
            , allowOutsideClick: false
            , allowEscapeKey: false
            , showCancelButton: true
            , confirmButtonText: 'Save it!'
            , focusCancel: true
        });

        $.fn.timeout = function (msg) {
            swal({title: 'Operation Timeout', html: '<br/>' + msg, type: 'info', showCancelButton: false, confirmButtonText: "OK"});
        };

        $.fn.missing = function (msg) {
            swal({title: 'Missing Information', html: '<br/>' + msg, type: 'warning', showCancelButton: false, confirmButtonText: "OK"});
        };

        $.fn.success = function (msg) {
            var msg = "<br/>That worked" + (msg ? " - " + msg : "") + "!";
            swal({title: "Cool!", html: msg, type: "success", showCancelButton: false, confirmButtonText: 'OK'});
        };

        $.fn.failed = function (msg) {
            var msg = "<br/>That failed" + (msg ? " - " + msg : "") + "!";
            swal({title: "Oops", html: msg, type: "error", showCancelButton: false, confirmButtonText: 'OK'});
        };

        $.fn.working = function (msg) {
            swal({
                title: 'Working ...',
                html: '<br/>Please be patient...' + (msg ? " " + msg : ""),
                imageUrl: 'data:image/gif;base64,',
                imageWidth: 66,
                imageHeight: 66,
                showCancelButton: false,
                showConfirmButton: false
            });
        };

        /** ResponseMonitor downloads **/
        $.fn.action = function (url, type, timeoutInSecs, callback) {
            var options = {
                onMonitor: function (counter) {
                },
                onResponse: function (status) {
                    if (typeof callback === 'function') {
                        callback.call(this, status);
                    } else {
                        if (status === 1) {
                            swal.close();
                        } else if (status === -1) {
                            $.fn.failed('The requested operation failed');
                        }
                    }
                },
                onTimeout: function () {
                    $.fn.timeout('The requested operation timed out. This does not mean that the operation has failed to complete. The operation may successfully complete in the future.');
                },
                timeout: timeoutInSecs
            };
            console.log(url);
            var monitor = new ResponseMonitor(url, options);
            monitor.execute();
        };

        /** jQquery slider **/
        $.fn.sliderMove = function (el, value) {
            el.find('span').text(value);
            elId = el.attr('id');
            elId = elId.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
            $('input[name=' + elId + ']').val(value).trigger('change');
        };

        $('.slider').each(function (e) {
            $(this).slider({
                value: $(this).attr('initial'),
                range: 'max',
                min: parseInt($(this).attr('min')),
                max: parseInt($(this).attr('max')),
                step: parseInt($(this).attr('step')),
                create: function () {
                    value = $(this).slider('value');
                    $.fn.sliderMove($(this), value);
                },
                slide: function (event, ui) {
                    $.fn.sliderMove($(this), ui.value);
                }
            });
        });

        /** jQquery datepicker **/
        $('.datepicker').each(function (e) {
            format = $(this).attr('format');
            if (!format) {
                format = 'yy-mm-dd';
            }
            changeMonth = $(this).attr('changeMonth');
            if (!changeMonth) {
                changeMonth = true;
            }
            changeYear = $(this).attr('changeYear');
            if (!changeYear) {
                changeYear = true;
            }
            $(this).datepicker({
                dateFormat: format,
                changeMonth: changeMonth,
                changeYear: changeYear
            });
        });

        /** jQuery colorpicker **/
        $('.color-picker').each(function (e) {
            $(this).iris({
                defaultColor: true,
                change: function (event, ui) {
                    $.fn.edited(true);
                },
                clear: function () {
                },
                hide: true,
                palettes: true
            });
        });

    });

});
